import Vue from "vue";
import Router from "vue-router";
import BooksList from "@/components/BooksList.vue";
import BookDetail from "@/views/BookDetail.vue";

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: "/",
      name: "BooksList",
      component: BooksList,
    },
    {
      path: "/book/:id",
      name: "BookDetail",
      component: BookDetail,
    },
  ],
});
